import { Injectable } from "@angular/core";
import { User } from "../login/user";

@Injectable()
export class UserService{


    constructor(private httpClient:HttpClient){
    }

    login(user:User){

       return this.httpClient.post("http://localhost:5114/api/UserApi/Login",user);

    }
}
